  false,\n\t\"url\": null,\n\t\"notes\": \"GLOBEC (GLOBal Ocean ECosystems Dynamics)
  NEP (Northeast Pacific)nRosette Bottle Data from New Horizon Cruise (NH0207: 1-19
  August 2002).nNotes:nPhysical data processed by Jane Fleischbein (OSU).nChlorophyll
  readings done by Leah Feinberg (OSU).nNutrient analysis done by Burke Hales (OSU).nSal00
  - salinity calculated from primary sensors (C0,T0).nSal11 - salinity calculated
  from secondary sensors (C1,T1).nsecondary sensor pair was used in final processing
  of CTD data fornmost stations because the primary had more noise and spikes. Thenprimary
  pair were used for cast #9, 24, 48, 111 and 150 due tonmultiple spikes or offsets
  in the secondary pair.nNutrient samples were collected from most bottles; all nutrient
  datandeveloped from samples frozen during the cruise and analyzed ashore;ndata developed
  by Burke Hales (OSU).nOperation Detection Limits for Nutrient ConcentrationsnNutrient
  \ Range         Mean    Variable         UnitsnPO4       0.003-0.004   0.004   Phosphate
  \       micromoles per liternN+N       0.04-0.08     0.06    Nitrate+Nitrite  micromoles
  per liternSi        0.13-0.24     0.16    Silicate         micromoles per liternNO2
  \      0.003-0.004   0.003   Nitrite          micromoles per liternDates and Times
  are UTC.nnFor more information, seenhttp://cis.whoi.edu/science/bcodmo/dataset.cfm?id=10180&flag=viewnnInquiries
  about how to access this data should be directed tonDr. Hal Batchelder (hbatchelder@coas.oregonstate.edu).\",\n\t\"license_title\":
